// import the library
import { library } from '@fortawesome/fontawesome-svg-core';

// import your icons
import {
    faGithubAlt,
    faGoogle,
    faCode,
    faFacebook,
    faTwitter
  } from '@fortawesome/free-brands-svg-icons';


library.add( faGithubAlt,
    faGoogle,
    faFacebook,
    faTwitter);
